For reference and ordering purposes, heated glass panes
conforming to this Standard shall be designated by
indicating the following elements in the order given:
a) denomination (abbreviated): glass pane;
b) number of this standard IS;
c) type of glass composition: A or B (see 4.2);
d) number of window size, as specified in Table 2;
e) thickness tl of carrier pane, as specified
in
Table 3;
f) minimum power loading, in w/dm2, as specified
in Table 5;
g) overheating protection device: code-letter S or
G; and
h) current rating given by the identification number
as specified in Table 6.
